    <>
         <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>

        <Link href='/' color='inherit' sx={{flexGrow:1 , "$:hover" : {fon}}} underline="none"> My expenses </Link>
          <p color="inherit" className=' me-3 pt-2'>Mariam Mohamed</p>
          <Stack direction="row" spacing={2}>
      <Avatar alt="Cindy Baker" src="https://mui.com/static/images/avatar/3.jpg" />
    </Stack>
        </Toolbar>
      </AppBar>
    </Box>

    
    
    
    
    </>
  )
}
